	<script>

		var CountryNumberInArray = 0;
		var once = true;
		
		function setCountry(country) {
			countryClicked = country;

			if (countryClicked == $('#pres').text()) {
				var temp = 0;
				once = true;
				
				//reduce chane of getting the same country again a little
				temp = Math.floor(Math.random() * allContries.length);
				if (temp == CountryNumberInArray) {
					CountryNumberInArray = Math.floor(Math.random() * allContries.length);
				} else {
					CountryNumberInArray = temp;
				}
				$('#pres').text(allContries[CountryNumberInArray]);
			} else {
			// if guess wrong increas chance of getting the country again
				if (once) {
					allContries.push(countryClicked);
					once = false;
					}
			}

		}
